import icons from "./icon"

const {MdOutlineLibraryMusic} = icons
export const sidbarMenu = [
    {
        path : 'my-music',
        test : 'Thư Viện',
        icons: <MdOutlineLibraryMusic/>
    },
    {
        path : '',
        test : 'Khám phá',
        icons: <MdOutlineLibraryMusic/>
    },
    {
        path : 'zing-chart',
        test : '#zingchart',
        icons: <MdOutlineLibraryMusic/>
    },
    {
        path : 'moi-phat-hanh',
        test : 'BXH Nhạc Mới',
        icons: <MdOutlineLibraryMusic/>
    },{
        path : 'hub',
        test : 'Chủ Đề & Thể Loại',
        icons: <MdOutlineLibraryMusic/>
    },{
        path : 'top100',
        test : 'Top 100',
        icons: <MdOutlineLibraryMusic/>
    }
]


export default sidbarMenu
